import { Fragment } from "react";
import { Route, Switch } from "react-router";
import Home from "./components/Home";
import MainNavigation from "./components/layout/MainNavigation";

function App() {
  return (
    <Fragment>
      <MainNavigation/>
      <Switch>
        <Route>
          <Home/>
        </Route>
      </Switch>
    </Fragment>

  );
}

export default App;
